CREATE TABLE organizations (
  id VARCHAR(10) PRIMARY KEY,
  organization_name VARCHAR(255),
  type ENUM('agency','personnel'),
  domain VARCHAR(100),
  description TEXT,
  email VARCHAR(150),
  website VARCHAR(200),
  country VARCHAR(100),
  city VARCHAR(100),
  founded_year INT,
  team_size INT,
  sdg_alignment JSON,
  goals JSON,
  skills JSON,
  services JSON,
  funding_stage VARCHAR(50),
  partners JSON,
  testimonials JSON,
  tags JSON,
  sdg_tags JSON,
  collaboration_needs JSON
);






